import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import {MyForm} from './login.js';

function App() {
  return (
    <div className="App">
      <MyForm/>
    </div>
  );
}

ReactDOM.render(<MyForm />, document.getElementById('root'));
